	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.muml.uppaal.UppaalXML".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	

	
	////---------------------------------------------------------------------------------------------------------------------------------
	//// XML STRUCTURE
	////---------------------------------------------------------------------------------------------------------------------------------
	//// Note on hidden terminals:
	//// Except for in the XML part comments are generally accepted ANYWHERE. That's
	//// why every rule referenced directly from any part of the XML rules (NTA, Template,
	//// Location, Edge) needs to be manually complemented with
	////   hidden(WS, SINGLE_LINE_COMMENT, MULTI_LINE_COMMENT)
	//// as otherwise the hidden(WS) thingy is inherited.
	//NTA uppaal::NTA hidden(WS):
	//	('<?xml version="1.0" encoding="utf-8"?>' |
	//	"<?xml version='1.0' encoding='utf-8'?>")
	//	"<!DOCTYPE nta PUBLIC '-//Uppaal Team//DTD Flat System 1.1//EN' 'http://www.it.uu.se/research/group/darts/uppaal/flat-1_1.dtd'>"
	//	'<' 'nta' '>' ('<' 'imports' '>' ANY_TOKEN_BUT_XML_CLOSE* '</' 'imports' '>')* ('<' 'declaration' '>'
	//	globalDeclarations=GlobalDeclarations '</' 'declaration' '>')? ('<' 'template' '>' template+=Template '</' 'template'
	//	'>')+ ('<' 'instantiation' '>' ANY_TOKEN_BUT_XML_CLOSE* '</' 'instantiation' '>')?
	//	// Parse the system declarations.
	//	'<' 'system' '>' systemDeclarations=SystemDeclarations '</' 'system' '>'
	//	'</' 'nta' '>';
	public NTAElements getNTAAccess() {
		return pNTA;
	}
	
	public ParserRule getNTARule() {
		return getNTAAccess().getRule();
	}
	
	//Template templates::Template hidden(WS): // The name of the template might have x- and y-coordinates for some reason, they must be skipped.
	//	'<' 'name' (('x' '=' STRING)? & ('y' '=' STRING)?) '>' name=ID '</' 'name' '>' ('<' 'parameter' '>'
	//	(parameter+=ParameterContainer (',' parameter+=ParameterContainer)*)? '</' 'parameter' '>')? ('<' 'declaration' '>'
	//	declarations=LocalDeclarations '</' 'declaration' '>')? // Get all the locations.
	//	location+=Location+ // Reference the initial location.
	//	'<' 'init' 'ref' '=' init=[templates::Location|STRING] '/>' // Get the transitions.
	//	edge+=Edge*;
	public TemplateElements getTemplateAccess() {
		return pTemplate;
	}
	
	public ParserRule getTemplateRule() {
		return getTemplateAccess().getRule();
	}
	
	//Location parsable::IdentifiableLocation hidden(WS):
	//	'<' 'location' ('id' '=' id=STRING & position=Point? & ('color' '=' colorCode=STRING)?) (
	//	// Locations without any subelements and stuff are also allowed.
	//	'/>'
	//	|
	//	// Close the tag.
	//	'>' ('<' 'name' (('x' '=' STRING)? & ('y' '=' STRING)?) '>' name=ID '</' 'name' '>')? (('<' 'label' 'kind' '='
	//	'"comments"' (('x' '=' STRING)? & ('y' '=' STRING)? & ('color' '=' STRING)?)
	//	'>'
	//	comment=CommentLabel
	//	'</' 'label' '>')? & ('<' 'label' 'kind' '=' '"invariant"' (('x' '=' STRING)? & ('y' '=' STRING)? & ('color' '='
	//	STRING)?)
	//	'>'
	//	invariant=Expression
	//	'</' 'label' '>')?) locationTimeKind=LocationKind?
	//	'</' 'location' '>');
	public LocationElements getLocationAccess() {
		return pLocation;
	}
	
	public ParserRule getLocationRule() {
		return getLocationAccess().getRule();
	}
	
