	//Edge templates::Edge hidden(WS): // Again skip the coordinates.
	//	'<' 'transition' (('x' '=' STRING)? & ('y' '=' STRING)? & ('color' '=' colorCode=STRING)?) '>' // Source...
	//	'<' 'source' 'ref' '=' source=[templates::Location|STRING] '/>' // Target...
	//	'<' 'target' 'ref' '=' target=[templates::Location|STRING] '/>' (('<' 'label' 'kind' '=' '"comments"' (('x' '='
	//	STRING)? & ('y' '=' STRING)? & ('color' '=' STRING)?) '>' comment=CommentLabel '</' 'label' '>')? & ('<' 'label'
	//	'kind' '=' '"synchronisation"' (('x' '=' STRING)? & ('y' '=' STRING)? & ('color' '=' STRING)?) '>'
	//	synchronization=SynchronizationLabel '</' 'label' '>')? & ('<' 'label' 'kind' '=' '"guard"' (('x' '=' STRING)? & ('y'
	//	'=' STRING)? & ('color' '=' STRING)?) '>' guard=Expression '</' 'label' '>')? & ('<' 'label' 'kind' '='
	//	'"assignment"' (('x' '=' STRING)? & ('y' '=' STRING)? & ('color' '=' STRING)?) '>' update+=Expression (','
	//	update+=Expression)* '</' 'label' '>')? & ('<' 'label' 'kind' '=' '"select"' (('x' '=' STRING)? & ('y' '=' STRING)? &
	//	('color' '=' STRING)?) '>' selection+=Selection (',' selection+=Selection)* '</' 'label' '>')?) ('<' 'nail'
